            this.boatGroupCenter.lon = 0.0;
            this.boatGroupCenter.lat = 0.0;
    	
    	    var yachts = Object.keys(vorData.yachts);
            for (var n = 0; n < yachts.length; n++)
            {
                this.setVORTrackEnabled(enabled, yachts[n], vorData.yachts[yachts[n]], this.meteoEarth);
            }

            this.boatGroupCenter.lon /= (yachts.length);
            this.boatGroupCenter.lat /= (yachts.length);
