                var dataTimeStamp = modTime0;
                var dataDir = rootDir + '/data' + dataTimeStamp;
                try{ FS.mkdir(dataDir); } catch(e) {}

                that.fileSystem = { bgDir: bgDir + "/", dataDir : dataDir + "/" };
