    getHttpRequest : function(url, responseType, callbackFunction) {
        var xmlhttp = new XMLHttpRequest();

        xmlhttp.open("GET", url, true);
        xmlhttp.onreadystatechange = callbackFunction;
        xmlhttp.responseType = responseType;
        xmlhttp.send(null);
    },


    fillUpZeros : function(value) {
        if(value < 10) {
            return "000"+value;
        } else if (value < 100) {
            return "00"+value;
        } else if (value < 1000) {
            return "0"+value;
        } else {
            return value;
        }
    },

    storeFileContentToCache : function(isBGContent, fileName, data) {
        if(!this.fileSystem) { return; }

        var dir = isBGContent ? this.fileSystem.bgDir : this.fileSystem.dataDir;
        FS.writeFile(dir + fileName, data, { encoding: 'binary' });

        // sync local mem files to backing IDB
        FS.syncfs(function (err) {
            if( err ) {
                Module.print("syncfs error: " + err );
            }
        });
    },

